DROP SCHEMA IF EXISTS daiquiri_data_sim CASCADE;
CREATE SCHEMA daiquiri_data_sim;

CREATE TABLE "daiquiri_data_sim"."halos" (
  "id" bigint primary key not null,
  "x" double precision not null,
  "y" double precision not null,
  "z" double precision not null,
  "vx" double precision not null,
  "vy" double precision not null,
  "vz" double precision not null,
  "mass" double precision not null
);

GRANT USAGE ON SCHEMA daiquiri_data_sim TO daiquiri_data;
GRANT SELECT ON ALL TABLES IN SCHEMA daiquiri_data_sim TO daiquiri_data;

;
